    "102915": {
        "Desc": "Поговорите с Е Лань",
        "Talk": [
            [
                {
                    "N": "_0",
                    "T": "(Сяо закрыл глаза и, кажется, спит. Но видит ли он сны? Это удивительно.)"
                },
                {
                    "N": "_0",
                    "T": "(Якса, который всегда настороже, тоже может видеть сны?)"
                }
            ]
        ]
    },
    "102919": {
        "Desc": "Поговорите с остальными",
        "Talk": []
    },
    "102920": {
        "Desc": "Поговорите с остальными",
        "Talk": [
            [
                {
                    "N": "Аратаки Итто",
                    "T": "Уси, ты не можешь снова найти эту проклятую дверь?"
                },
                {
                    "N": "Уси",
                    "T": "Му..."
                },
                {
                    "N": "_0",
                    "T": "Поговорим о той двери..."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Ты как раз вовремя. Я сейчас обсуждаю этот вопрос с Уси."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Ладно ещё из двери в меня бобами кидаются. Но то, что она смеет доставлять тебе неприятности - такого я уже не потерплю!"
                },
                {
                    "N": "Уси",
                    "T": "Му, му..."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Что? Ничего не выходит? Крепыш, нельзя так рано сдаваться."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "А давай ещё раз попробуешь? Если не получится, то поищем другую дверь. Желательно такую, которая ведёт прямо во внешний мир, как тебе?"
                },
                {
                    "N": "_0",
                    "T": "Что нам теперь делать..."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Хм, хороший вопрос."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Но я не знаю."
                },
                {
                    "N": "Уси",
                    "T": "Му... Му-у!"
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Эй, не сердись, я правду говорю."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Я всё думал, не попробовать ли мне прокопать путь наружу, но здесь камни покрепче тюремных стен..."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "...под натиском Уси даже не шелохнулись. Явно дают нам понять, что не хотят нас выпускать."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Сейчас я могу только... Хм... Поухаживать за этой приунывшей фиалковой дынькой."
                },
                {
                    "N": "Уси",
                    "T": "Му-у! Му."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Ах да, Уси тоже поможет."
                },
                {
                    "N": "_0",
                    "T": "Не буду больше беспокоить тебя."
                },
                {
                    "N": "Аратаки Итто",
                    "T": "Да что там. Помни, даже если небо будет падать, я удержу его руками! Так что предоставь фиалковую дыньку мне и ни о чём не волнуйся."
                }
            ]
        ]
    },
    "102921": {
        "Desc": "Поговорите с остальными",
        "Talk": [
            [
                {
                    "N": "Янь Фэй",
                    "T": "Ты совсем не спала. Точно всё в порядке? Это пространство оказалось более опасным, чем мы себе представляли."
                },
                {
                    "N": "Е Лань",
                    "T": "Не волнуйся. Долго и сосредоточенно работать - это мой конёк."
                },
                {
                    "N": "Е Лань",
                    "T": "Кстати, похоже, у тебя есть новые догадки."
                },
                {
                    "N": "Янь Фэй",
                    "T": "Разве заметно?"
                },
                {
                    "N": "Е Лань",
                    "T": "Читать по лицу - часть моей работы."
                },
                {
                    "N": "Янь Фэй",
                    "T": "Я так и подумала. Есть у меня некоторые идеи, но я их ещё не обдумала как следует. Как только я разберусь до конца, я тебе расскажу."
                },
                {
                    "N": "Е Лань",
                    "T": "Хорошо."
                },
                {
                    "N": "Е Лань",
                    "T": "У меня тоже есть кое-какие предположения. Как только всё подтвердится, я поделюсь с тобой."
                },
                {
                    "N": "_0",
                    "T": "Какой содержательный разговор."
                },
                {
                    "N": "Е Лань",
                    "T": "Ха-ха, да?"
                },
                {
                    "N": "Янь Фэй",
                    "T": "Как говорится, одна голова хорошо, а две лучше."
                }
            ]
        ]
    },
